import { useState } from "react";

const categories = [
  { name: "교복 떡메", items: [
    { name: "남자 하복", price: 1500 },
    { name: "여자 하복", price: 1500 },
    { name: "1학년 생활복", price: 1500 },
    { name: "2학년 생활복", price: 1500 },
    { name: "3학년 생활복", price: 1500 }
  ]},
  { name: "학교 전경 엽서", items: [
    { name: "학교 전경 엽서", price: 1500 }
  ]},
  { name: "학교 건물 스티커", items: [
    { name: "학교 건물 스티커", price: 1000 }
  ]},
  { name: "띠부띠부씰", items: [
    { name: "1", price: 500 },
    { name: "2", price: 500 },
    { name: "3", price: 500 },
    { name: "4", price: 500 }
  ]},
  { name: "학교 건물 포스트잇", items: [
    { name: "1", price: 1000 },
    { name: "2", price: 1000 }
  ]}
];

export default function GoodsTracker() {
  const [goods, setGoods] = useState(
    categories.map((category) => ({
      name: category.name,
      items: category.items.map((item) => ({ ...item, sold: 0 }))
    }))
  );

  const handleAdjust = (categoryIndex, itemIndex, delta) => {
    setGoods((prevGoods) =>
      prevGoods.map((category, cIndex) =>
        cIndex === categoryIndex
          ? {
              ...category,
              items: category.items.map((item, iIndex) =>
                iIndex === itemIndex ? { ...item, sold: Math.max(0, item.sold + delta) } : item
              )
            }
          : category
      )
    );
  };

  const totalRevenue = goods.reduce(
    (sum, category) =>
      sum + category.items.reduce((catSum, item) => catSum + item.price * item.sold, 0),
    0
  );

  return (
    <div className="bg-pink-100 min-h-screen flex flex-col items-center justify-center p-6">
      <h1 className="text-4xl font-bold text-pink-600 mb-6">🌸 학홍 굿즈 판매 현황 🌸</h1>
      <div className="w-full max-w-3xl">
        {goods.map((category, categoryIndex) => (
          <div key={categoryIndex} className="bg-white p-6 rounded-2xl shadow-lg mb-6">
            <h2 className="text-2xl font-bold text-pink-700 mb-4">{category.name}</h2>
            <table className="w-full border-collapse">
              <thead>
                <tr className="bg-pink-300 text-white text-lg">
                  <th className="p-4">상품명</th>
                  <th className="p-4">가격</th>
                  <th className="p-4">판매 수량</th>
                  <th className="p-4">조정</th>
                </tr>
              </thead>
              <tbody>
                {category.items.map((item, itemIndex) => (
                  <tr key={itemIndex} className="border-b text-center text-lg">
                    <td className="p-4">{item.name}</td>
                    <td className="p-4">{item.price}원</td>
                    <td className="p-4">{item.sold}</td>
                    <td className="p-4">
                      <button
                        onClick={() => handleAdjust(categoryIndex, itemIndex, -1)}
                        className="bg-pink-500 text-white px-6 py-3 rounded-full mx-3"
                      >
                        -
                      </button>
                      <button
                        onClick={() => handleAdjust(categoryIndex, itemIndex, 1)}
                        className="bg-pink-500 text-white px-6 py-3 rounded-full mx-3"
                      >
                        +
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        ))}
      </div>
      <div className="mt-6 text-3xl font-bold text-pink-700">
        총 판매 금액: {totalRevenue.toLocaleString()}원
      </div>
    </div>
  );
}
